import ReactDOM from 'react-dom';
import './Navbar.scss';
import logo from './grc-logo.svg';
import $ from 'jquery';

import { Link } from 'react-router-dom';

import React, { Component } from 'react'

export default class GrcNavbar extends Component {
  componentDidMount () {
    $('.hamburger1').on('click', function() {
      $('.rectangle').addClass('show-bottom');
      $('.bottom').removeClass('shrink').addClass('expand');
      $('article').addClass('expand-body');
      setTimeout(function() {
        $('ul').fadeIn();}, 500);
    });

    $('.hamburger2').on('click', function() {
      $('ul').fadeOut();
      $('.bottom').removeClass('expand').addClass('shrink');
      $('article').removeClass('expand-body');
      setTimeout(function() {
        $('.rectangle').removeClass('show-bottom');}, 550);
    });
  }
  render() {
    return (
      <div>

      </div>
    )
  }
}
